import './App.css';

function App() {
  return (
    <div className="App">
      <div id="top-bar">
        <div><a>About</a><a>Store</a></div>
        <div><a>Gmail</a><a>Images</a><a>...</a><a>Profile</a></div>
      </div>
      <div id="content"></div>
      <div id="bottom-bar"></div>
    </div>
  );
}

export default App;
